import React from 'react';

const withAdditionalFunctionality = (WrappedComponent) => {
    class WithAdditionalFunctionality extends React.Component {
        handleClick() {
            // Perform additional functionality on click
            console.log('Button clicked');
        }

        render() {
            // Render the wrapped component with the additional functionality
            return (
                <div>
                    <WrappedComponent {...this.props} />
                    <button onClick={this.handleClick}>Click me</button>
                </div>
            );
        }
    }

    return WithAdditionalFunctionality;
};

export default withAdditionalFunctionality;
